import logo from './logo.svg';
import React, {useState} from 'react';
import './App.css';
import door from './images/Realistic - door.png'
import electrical from './images/Realistic - electrical.png'
import recap from './images/821.png'
import lover from './images/lover.png'
import hello from './images/hello world.png'
import dior from './images/dior.png'
import diptyque from './images/diptyque.png'
import dressroom from './images/dressroom.png'
import pink from './images/pink.png'
import disney from './images/SAM_1029.JPG'
import blueflowers from './images/SAM_1075.JPG'
import ocean from './images/SAM_1105.JPG'
import getty from './images/SAM_1088.JPG'
import garden from './images/SAM_1055.JPG'
import palmtrees from './images/SAM_1108.JPG'
import ducks from './images/SAM_1057.JPG'
import tree from './images/SAM_1054.JPG'

import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import ListSubheader from '@mui/material/ListSubheader';
import IconButton from '@mui/material/IconButton';
import InfoIcon from '@mui/icons-material/Info';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';

const pages = ['Experience', 'Project', 'About'];
const myphotos = [
  {
    img: disney,
    title: '',
    author: 'Where dreams come true',
    rows: 2,
    cols: 2,
    featured: true,
  },
  {
    img: blueflowers,
    title: '',
    author: 'Flowers',
  },
  {
    img: ocean,
    title: '',
    author: 'Beach',
  },
  {
    img: getty,
    title: '',
    author: 'Getty',
    cols: 2,
  },
  {
    img: garden,
    title: '',
    author: 'Bird near water',
    cols: 2,
  },
  {
    img: palmtrees,
    title: '',
    author: 'Shape of leaves',
    rows: 2,
    cols: 2,
    featured: true,
  },
  {
    img: ducks,
    title: '',
    author: 'Two ducks on the ledge',
  },
  {
    img: tree,
    title: '',
    author: 'Mix of nature and architecture',
  },
  {
    img: 'https://images.unsplash.com/photo-1597645587822-e99fa5d45d25',
    title: 'Mushrooms',
    author: '@silverdalex',
    rows: 2,
    cols: 2,
  },
  {
    img: 'https://images.unsplash.com/photo-1567306301408-9b74779a11af',
    title: 'Tomato basil',
    author: '@shelleypauls',
  },
  {
    img: 'https://images.unsplash.com/photo-1471357674240-e1a485acb3e1',
    title: 'Sea star',
    author: '@peterlaster',
  },
  {
    img: 'https://images.unsplash.com/photo-1589118949245-7d38baf380d6',
    title: 'Bike',
    author: '@southside_customs',
    cols: 2,
  },
];

const itemData = [
  {
    img: door,
    title: 'door',
    author: "\"Sunlit day at the door of 227\""
  },
  {
    img: electrical,
    title: 'electrical',
    author: "\"You left the power on.\""
  },
  {
    img: lover,
    title: 'lover',
    author: "\"Lovers are stronger than Haters\""
  },
  {
    img: hello,
    title: 'hello world',
    author: "\"My coding habits are coming out in 3D\""
  },
  {
    img: dior,
    title: 'dior',
    author: "\"The perfume on my mom's vanity\""
  },
  {
    img: diptyque,
    title: 'diptyque',
    author: "\"Untitled\""
  },
  {
    img: dressroom,
    title: 'dressroom',
    author: "\"Plastic perfume bottle\""
  },
  {
    img: pink,
    title: 'pink',
    author: "\"Shadows in pink\""
  },
  {
    img: recap,
    title: 'recap',
  },
  {
    img: 'https://images.unsplash.com/photo-1516455207990-7a41ce80f7ee',
    title: 'Storage',
  },
  {
    img: 'https://images.unsplash.com/photo-1597262975002-c5c3b14bbd62',
    title: 'Candle',
  },
  {
    img: 'https://images.unsplash.com/photo-1519710164239-da123dc03ef4',
    title: 'Coffee table',
  },
];

function App() {
  let photos = "Photos on Digital Camera"
  let artwork = 'My Creations';
  let [like, likechange] = useState(0);
  return (
    <div className="App">
      <AppBar position="static">
      <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
            {pages.map((page) => (
              <Button
                key={page}
                onClick={handleCloseNavMenu}
                sx={{ my: 2, color: 'white', display: 'block' }}
              >
                {page}
              </Button>
            ))}
          </Box>
      </AppBar>
      <div className='black-nav'>
        <div style={ { color: 'pink', fontSize: '30px'}}>My Portfolio </div>
      </div>
      <div className='list'>
      <Box sx={{
        width: 1000,
        height: 200,
        backgroundColor: 'primary.dark',
        '&:hover': {
          backgroundColor: 'primary.main',
          opacity: [0.9, 0.8, 0.7],
        },
      }}>
        <Paper elevation={3} >
        <h1> Alice Lee </h1>
        <p> Who am I? </p>
        </ Paper>
      </Box >
      <div className='list'>
        <Box sx={{
        width: 1000,
        height: 200,
        backgroundColor: 'primary.dark',
        '&:hover': {
          backgroundColor: 'primary.main',
          opacity: [0.9, 0.8, 0.7],
        },
      }}>
      <Paper elevation={3} >
        <hr/>
        <h1> Education <span onClick={ ()=>{ likechange(like + 1) }}> ❤️ </span> {like} </h1>
        <p> What did I learn in College? </p>
        <hr/>
      </Paper>
      </Box>
      </div>
      <div className='list'>
      <Box sx={{
        width: 1000,
        height: 200,
        backgroundColor: 'primary.dark',
        '&:hover': {
          backgroundColor: 'primary.main',
          opacity: [0.9, 0.8, 0.7],
        },
      }}>
      <Paper elevation={3} >
        <h1> Experiences </h1>
        <p> What have I done over the years? </p>
        <hr/>
      </Paper>
      </Box>
      </div>
      <h1> {photos} </h1>
      <ImageList sx={{width: 1545, height: 3100}}>
      <ImageListItem key="Subheader" cols={2}>
        <ListSubheader component="div"></ListSubheader>
      </ImageListItem>
      {myphotos.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}?w=248&fit=crop&auto=format`}
            srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
          <ImageListItemBar
            title={item.title}
            subtitle={item.author}
            actionIcon={
              <IconButton
                sx={{ color: 'rgba(255, 255, 255, 0.54)' }}
                aria-label={`info about ${item.title}`}
              >
                <InfoIcon />
              </IconButton>
            }
          />
        </ImageListItem>
      ))}
    </ImageList>
      <h1> {artwork}</h1>
      <ImageList variant="masonry" cols={3} gap={8}>
        {itemData.map((item) => (
        <ImageListItem key={item.img}>
        <img
        src={`${item.img}?w=248&fit=crop&auto=format`}
        srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
        alt={item.title}
        loading="lazy"
        />
        <ImageListItemBar position="below" title={item.author} />
        </ImageListItem>
        ))}
      </ImageList>
      </div>
    </div>
  );
}

export default App;
